import React, { Component } from 'react'

export class Order extends Component {
  render() {
    return (
      <div className='item'>
                <img src={'./img/'+ this.props.Good.img} />
                <div>
                    <h1>{this.props.Good.title}</h1>
                    <b>{this.props.Good.price}</b>
                </div >
      </div>

    )
  }
}

export default Order
